import React from "react";
import {Box,Typography} from "@mui/material";

const HorizontalScrollbar =({data})=>{
    return(
        <div>
            {data.map((items)=>(
            <Box
            key={items.id || items}
            itemId={items.id|| items}
            title={items.id||items}
            m="0 40px" 
            // position='relative'
            >
            {items}
            <Typography>{`Hello`}</Typography>
            {/* console.log(item);    */}
            </Box>
            )
    )}     
        </div>
    )
}

export default HorizontalScrollbar;
